    var dayOfWeek = date.getDay();
    var daysUntilSunday = 7 - dayOfWeek;
    date.setDate(date.getDate() + daysUntilSunday);
    date.setHours(0);
    date.setMinutes(0);
    date.setSeconds(0);
    date.setMilliseconds(0);
    logger.debug("time "+ date);
    var size=7*24;

    var finalTable = Resources["InfoTableFunctions"].CreateInfoTableFromDataShape({
        infoTableName: "InfoTable",
        dataShapeName: "CADIT.TR.Muzakki.SimulationData.CurrencyList.DataShape"
    });

    //simulating currency for 7 day and 24 hour
    for(var i=0;i<size;i++){
        valueHour=0;
        //simulating data every 15 minutes
        for(var j=0;j<4;j++){
            var factor = (Math.random() * 0.6) + 0.7;
        	var newValue = value*factor; 
            valueHour=valueHour+newValue;
        }
        valueHour=valueHour/4;
    	var time = new Date(date.getTime() + (i * 60 * 60 * 1000));   
        var timeString = time.toTimeString().substring(0, 5);
        //logger.debug("time "+i+" "+ timeString+ " "+valueHour);      
        let newEntry = {
            Hour:timeString,
            CurrencyByHour:valueHour
        };
        finalTable.AddRow(newEntry);
    }
    result=finalTable;
    }catch(error){
    	logger.error("[" + me.name + " CurrencySimulation] " + error);
    }
	/****************** PUT YOUR MAIN PROGRAM HERE*******************/
}());

